		_this.r = new XMLHttpRequest();
		
		_this.r.addEventListener("load",rF );
		
		//click events for stage buttons-----------------
		_this.btn_correct1.addEventListener("click",correctDisable1);
		_this.btn_wrong1.addEventListener("click",wrongDisable1);
		_this.btn_wrong2.addEventListener("click",wrongDisable2);
		_this.btn_wrong3.addEventListener("click",wrongDisable3);
		_this.btn_wrong4.addEventListener("click",wrongDisable4);
		
